import "./todolist";
export const todolist = () => {
  return (
    <div className="todolist">
      <div className="todolistWrapper">
        <div className="top">
          <div className="topContainer">
            <div className="topLeft"></div>
            <div className="topRight"></div>
          </div>
        </div>
        <div className="middle"></div>
        <div className="buttom"></div>
      </div>
    </div>
  );
};
